style.css:
@-moz-document domain("www.youtube.com") {
polygon.ytd-topbar-logo-renderer {
    fill: #2c2c2c
}
path.ytd-topbar-logo-renderer {
    fill: #fff
}
ytd-guide-entry-renderer[active] .guide-icon.ytd-guide-entry-renderer {
    color: #2c2c2c;
}
#progress.ytd-thumbnail-overlay-resume-playback-renderer {
    background-color: #2c2c2c;
    height: 100%;
}
.ytp-red2 .ytp-swatch-background-color, .ytp-red2 .ytp-swatch-background-color-secondary {
    background-color: #2c2c2c;
}
.ytp-ad-progress {
    z-index: 36;
    background-color: rgba(255, 255, 255, 0);
}
#like-bar.ytd-sentiment-bar-renderer {
    background: #2c2c2c;
    height: 2px;
    transition: width 0.0s;
}
ytd-button-renderer.style-suggestive[is-paper-button] paper-button.ytd-button-renderer {
    border: 1px solid #2c2c2c;
    padding: var(--yt-button-padding-minus-border);
}
ytd-button-renderer #button.ytd-button-renderer {
    color: #2c2c2c;
    background-color: transparent;
    text-transform: inherit;
}
a.yt-simple-endpoint.yt-formatted-string {
    color: #505050;
}
.ytp-red2 .ytp-settings-button.ytp-hd-quality-badge:after, .ytp-red2 .ytp-settings-button.ytp-4k-quality-badge:after, .ytp-red2 .ytp-settings-button.ytp-5k-quality-badge:after, .ytp-red2 .ytp-settings-button.ytp-8k-quality-badge:after, .ytp-red2 .ytp-settings-button.ytp-3d-badge-grey:after, .ytp-red2 .ytp-settings-button.ytp-3d-badge:after {
    background-color: #2c2c2c;
}
ytd-toggle-button-renderer #button.ytd-toggle-button-renderer {
    color: #2c2c2c;
    background-color: transparent;
    text-transform: inherit;
}
paper-button.ytd-subscribe-button-renderer {
    background-color: #2c2c2c;
    border-radius: 2px;
    padding: 10px 16px;
    margin: auto 4px;
    white-space: nowrap;
    font-size: 1.4rem;
    font-weight: 500;
    letter-spacing: .007px;
    text-transform: uppercase;
    display: flex;
    -ms-flex-direction: row;
    -webkit-flex-direction: row;
    flex-direction: row;
}
#watch-card-header.ytd-generic-watch-card {
    background: #2c2c2c;
    color: hsl(0, 0%, 100%);
    padding: 16px;
}
#img-endpoint.ytd-watch-card-collage-renderer #overlay-button.ytd-watch-card-collage-renderer {
    position: absolute;
    bottom: 16px;
    left: 16px;
    color: hsl(0, 0%, 100%);
    background: #2c2c2c;
}
paper-tab.iron-selected.ytd-generic-watch-card {
    color: #2c2c2c;
}
paper-tabs.ytd-generic-watch-card {
    -paper-tabs-selection-bar-color: #2c2c2c;
    height: 40px;
    padding-top: 8px;
}
ytd-searchbox[mode=legacy][has-focus] #container.ytd-searchbox {
    border: 1px solid #000000
}
ytd-searchbox[mode=legacy] #container.ytd-searchbox:hover {
    border: 1px solid #000000
}
ytd-subscribe-button-renderer:not([button-style]) paper-button:not([subscribed]) {
    background-color: #181717 !important;
}
ytd-searchbox[mode=legacy] #search-icon-legacy.ytd-searchbox:hover {
    border-color: #000000
}
paper-toggle-button[checked]:not([disabled]) .toggle-button.paper-toggle-button {
    background-color: #2c2c2c;
}
paper-toggle-button[checked]:not([disabled]) .toggle-bar.paper-toggle-button {
    opacity: 0.5;
    background-color: #2c2c2c;
}
paper-toggle-button[checked] .toggle-ink.paper-toggle-button {
    color: #2c2c2c;
    opacity: 0;
    background-color: rgb(44, 44, 44);
}
.ytp-swatch-background-color, .ytp-swatch-background-color-secondary {
    background-color: #2c2c2c;
}
.ytp-settings-button.ytp-hd-quality-badge:after, .ytp-settings-button.ytp-4k-quality-badge:after, .ytp-settings-button.ytp-5k-quality-badge:after, .ytp-settings-button.ytp-8k-quality-badge:after {
    content: '';
    position: absolute;
    top: 10px;
    right: 5px;
    height: 9px;
    width: 13px;
    background-color: #2c2c2c;
    border-radius: 1px;
    line-height: normal;
}
.ytp-large-play-button.ytp-touch-device .ytp-large-play-button-bg, .ytp-cued-thumbnail-overlay:hover .ytp-large-play-button-bg {
    -moz-transition: fill .1s cubic-bezier(0.0,0.0,0.2,1),fill-opacity .1s cubic-bezier(0.0,0.0,0.2,1);
    -webkit-transition: fill .1s cubic-bezier(0.0,0.0,0.2,1),fill-opacity .1s cubic-bezier(0.0,0.0,0.2,1);
    transition: fill .1s cubic-bezier(0.0,0.0,0.2,1),fill-opacity .1s cubic-bezier(0.0,0.0,0.2,1);
    fill: #505050;
    fill-opacity: 1;
}
}
